import React from 'react';
import './Form.css';

export default class Form extends React.Component {
  state = {
    input: ''
  }

  render() {
    return (
      <div id="form-container">
        <form id="form" method="post">
          <input type="text"
            id="input"
            placeholder="Paste your URL here..."
            autocomplete="off"
            required
          />
          <button type="submit">Chonk!</button>
        </form>
  
      </div>
    );
  }
}
